{"1": ["Вставила батарейку 9v как указано в инструкции. Лампочка не загорелась, на лай не реагирует. Зачем продавать поломанные товары?", "2020-11-14T19:06:24Z", "", "0", 1, 0, 1, "Ультразвуковое устройство- антилай для собак", "Migliores"], "2": ["Батарейку поставила, но совершенно неясно, включился ли аппарат? Должна лампочка загореться? Собака пока лает, но прошёл первый день.", "2020-09-15T00:40:01Z", "", "0", 2, 0, 2, "Ультразвуковое устройство- антилай для собак", "Migliores"], "3": ["Спасибо. Покупкой довольна. Мой 60 кг.барбос наконец-то заткнулся. Выл ужасным басом. Никакими прогулками и общением его было не заткнуть.  Понял со второго раза, что выть теперь не комфортно. Очень рада, что не убедили меня отрицательные отзывы и я рискнула купить это устройство.", "2020-08-18T04:51:49Z", "", "0", 2, 2, 5, "Ультразвуковое устройство- антилай для собак", "Migliores"], "4": ["Не работает.Висит на двери 3 месяца,прямо перед собакой в рост. Как лаяла(орала),так и лает", "2020-08-14T14:45:15Z", "", "0", 1, 0, 1, "Ультразвуковое устройство- антилай для собак", "Migliores"], "5": ["Бесполезный выброс денег! Обман полный! Собака не чувствует этот аппарат! ", "2020-04-14T05:49:36.370180213Z", "colorless", "0", 4, 0, 1, "Ультразвуковое устройство- антилай для собак", "Migliores"], "6": ["Повесила в прихожую возле двери, чтобы собака не подходила и не лаяла. На собаку не действует. Зато соседи стали меньше ходить по подъезду.", "2020-03-22T12:58:13.194781952Z", "colorless", "0", 18, 0, 1, "Ультразвуковое устройство- антилай для собак", "Migliores"], "7": ["Не работает", "2020-03-16T12:29:31.132821405Z", "colorless", "0", 2, 0, 5, "Ультразвуковое устройство- антилай для собак", "Migliores"], "8": ["Кошки реагируют, на собаках ещё не опробовали.", "2020-02-12T10:39:48.994325431Z", "colorless", "0", 1, 0, 5, "Ультразвуковое устройство- антилай для собак", "Migliores"], "9": ["Не работает", "2019-12-18T16:32:20.815571337Z", "colorless", "0", 1, 0, 1, "Ультразвуковое устройство- антилай для собак", "Migliores"], "12": ["Согласна на 100% с предыдущим отзывом! Батарейка нужна крона. Тоже возврат будет!", "2019-04-29T20:41:02.817780959Z", "белый", "0", 7, 0, 1, "Ультразвуковое устройство- антилай для собак", "Migliores"], "13": ["Начнем с того, что в описании указан неверный тип батареи. Инструкции никакой нет. Признаков жизни не подает. Буду оформлять возврат.", "2019-04-28T18:28:06.114262075Z", "белый", "0", 4, 0, 1, "Ультразвуковое устройство- антилай для собак", "Migliores"]}
